import react, { useState, useEffect } from "react";
import Home from "./Home";

const Blogs = () => {
    useEffect(() => {
        document.title = "Blog Posts of Mohsinur Rahman";
    }, []);
    return (
        <>
            <Home />
        </>
    );
};
  
export default Blogs;
